script: |
  super -f text -I q3125.spq | sort > q3125.out

inputs:
  - name: q3125.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 * - 84 NOT BETWEEN col1 + col0 + - ( - - col1 ) AND ( + col0 );
  - name: tab0

outputs:
  - name: q3125.out
    data: |
      15	81	47
      87	21	10
      97	1	99
